import React from 'react';
import './Nav.css';

const Nav = () => {
	return (
		<div className="nav-container">
			<div className="nav-bar">
				<div className="nav-brand"></div>
				<div className="nav-link">About</div>
			</div>
		</div>
	);
};

export default Nav;
